    @Test
    fun canImportFromChrome() {
        val html = "\n" +
            "<!DOCTYPE NETSCAPE-Bookmark-file-1>\n" +
            "<!-- This is an automatically generated file.\n" +
            "     It will be read and overwritten.\n" +
            "     DO NOT EDIT! -->\n" +
            "<META HTTP-EQUIV=\"Content-Type\" CONTENT=\"text/html; charset=UTF-8\">\n" +
            "<TITLE>Bookmarks</TITLE>\n" +
            "<H1>Bookmarks</H1>\n" +
            "<DL><p>\n" +
            "    <DT><H3 ADD_DATE=\"1591951551\" LAST_MODIFIED=\"1604574986\" PERSONAL_TOOLBAR_FOLDER=\"true\">Bookmarks bar</H3>\n" +
            "    <DL><p>\n" +
            "        <DT><A HREF=\"https://jupyter.duckduckgo.com/notebooks/Mobile/Android%20Monday%20Health%20Check%20(DO%20NOT%20CHANGE).ipynb\" ADD_DATE=\"1592401423\" ICON=\"data:image/png;base64,\">Android Monday Health Check</A>\n" +
            "        <DT><A HREF=\"https://play.google.com/apps/publish/?account=5949020878215944484#AppListPlace\" ADD_DATE=\"1592401445\" ICON=\"data:image/png;base64,\">DDG - Google Play Console</A>\n" +
