    @Test
    fun parsesBookmarksAndFolders() {
        val html = "\n" +
            "<!DOCTYPE NETSCAPE-Bookmark-file-1>\n" +
            "<!-- This is an automatically generated file.\n" +
            "     It will be read and overwritten.\n" +
            "     DO NOT EDIT! -->\n" +
            "<META HTTP-EQUIV=\"Content-Type\" CONTENT=\"text/html; charset=UTF-8\">\n" +
            "<TITLE>Bookmarks</TITLE>\n" +
            "<H1>Bookmarks Menu</H1>\n" +
            "\n" +
            "<DL><p>\n" +
            "    <DT><H3 ADD_DATE=\"1618844074\" LAST_MODIFIED=\"1618844074\">Mozilla Firefox</H3>\n" +
            "    <DL><p>\n" +
            "        <DT><A HREF=\"https://support.mozilla.org/en-US/products/firefox\" ADD_DATE=\"1618844074\" LAST_MODIFIED=\"1618844074\" ICON_URI=\"fake-favicon-uri:https://support.mozilla.org/en-US/products/firefox\" ICON=\"data:image/png;base64,\">Get Help</A>\n" +
            "        <DT><A HREF=\"https://support.mozilla.org/en-US/kb/customize-firefox-controls-buttons-and-toolbars?utm_source=firefox-browser&utm_medium=default-bookmarks&utm_campaign=customize\" ADD_DATE=\"1618844074\" LAST_MODIFIED=\"1618844074\" ICON_URI=\"fake-favicon-uri:https://support.mozilla.org/en-US/kb/customize-firefox-controls-buttons-and-toolbars?utm_source=firefox-browser&utm_medium=default-bookmarks&utm_campaign=customize\" ICON=\"data:image/png;base64,\">Customize Firefox</A>\n" +
            "        <DT><A HREF=\"https://www.mozilla.org/en-US/contribute/\" ADD_DATE=\"1618844074\" LAST_MODIFIED=\"1618844074\" ICON_URI=\"fake-favicon-uri:https://www.mozilla.org/en-US/contribute/\" ICON=\"data:image/png;base64,\">Get Involved</A>\n" +
            "        <DT><A HREF=\"https://www.mozilla.org/en-US/about/\" ADD_DATE=\"1618844074\" LAST_MODIFIED=\"1618844074\" ICON_URI=\"fake-favicon-uri:https://www.mozilla.org/en-US/about/\" ICON=\"data:image/png;base64,\">About Us</A>\n" +
            "    </DL><p>\n" +
            "    <DT><H3 ADD_DATE=\"1618844074\" LAST_MODIFIED=\"1618844163\" PERSONAL_TOOLBAR_FOLDER=\"true\">Bookmarks Toolbar</H3>\n" +
            "    <DL><p>\n" +
            "        <DT><A HREF=\"https://www.mozilla.org/en-US/firefox/central/\" ADD_DATE=\"1618844074\" LAST_MODIFIED=\"1618844074\" ICON_URI=\"fake-favicon-uri:https://www.mozilla.org/en-US/firefox/central/\" ICON=\"data:image/png;base64,\">Getting Started</A>\n" +
            "        <DT><A HREF=\"https://as.com/\" ADD_DATE=\"1618844147\" LAST_MODIFIED=\"1618844147\">AS.com - Diario online deportivo. Fútbol, motor y mucho más</A>\n" +
            "        <DT><A HREF=\"https://duckduckgo.com/\" ADD_DATE=\"1618844163\" LAST_MODIFIED=\"1618844163\" ICON_URI=\"https://duckduckgo.com/assets/icons/meta/DDG-iOS-icon_152x152.png\" ICON=\"data:image/png;base64,\">DuckDuckGo — Privacy, simplified.</A>\n" +
            "    </DL><p>\n" +
            "</DL>\n"

        val document = Jsoup.parse(html)
        val fileItems = document.select("DT")

        var folders = 0
        var links = 0
        val validBookmarks = mutableListOf<Bookmark>()

        fileItems.forEach {
            if (it.hasClass("H3")) {
                folders ++
            }
            if (it.hasClass("a")) {
                links ++
                val link = it.attr("href")
                val title = it.text()
                val bookmark = Bookmark(title, link)
                validBookmarks.add(bookmark)
            }
        }

        assertEquals(9, fileItems.size)
    }

